import Vue from 'vue'
import Vuex from 'vuex'
import {LoginForm, User} from "@/ts/DataDef"
import API from '@/ts/api'

Vue.use(Vuex)

const notLogin = <User>{
  ID: 'please login',
  group: '',
  avatar: 'data:image/jpg;base64,'
}

export default new Vuex.Store({
  state: {
    user: notLogin,
    sideNav: <boolean>false,
    nav: [{
      text: 'nav-bar.home',
      icon: 'mdi-home-circle-outline',
      to: '/'
    }, {
      text: 'nav-bar.help',
      description: 'nav.help_des',
      icon: 'mdi-help-circle-outline',
      to: '/help'
    }, {
      text: 'nav-bar.problems',
      icon: 'mdi-folder-outline',
      to: '/problem/all'
    }, {
      text: 'nav-bar.state',
      icon: 'mdi-state-machine',
      to: '/state/all'
    }, {
      text: 'nav-bar.assignment',
      icon: 'mdi-clipboard-text',
      to: '/assignment/all'
    }],
    navUser: {
      profile:
        {
          text: 'nav-user.profile',
          icon: 'mdi-',
          to: '/user/profile'
        },
      signOut:
        {
          text: 'nav-user.sign-out',
          icon: 'mdi-',
          event: 'signOut'
        }
    }
  },
  mutations: {
    setUser(state, value) {
      state.user = value.user
    }
    ,
    setSideNav(state, value) {
      state.sideNav = value.v
    }
  }
  ,
  actions: {
    async login({commit}, login_form
      :
      LoginForm
    ) {
      let user = await API.login(login_form)
      commit('setUser', {user: user})
    }
    ,
    async signOut({commit, state}) {
      let re = await API.signOut('')
      console.log('sign out')
      commit('setUser', {user: notLogin})
    }
  }
  ,
  modules: {}
})
